import React from 'react';
import Stock from './stock'; // Import the Stock component


// Render Stock components, each with a different ticker
function App() {
    return (
        <div className="App">
            <Stock ticker="AAPL" /> 
            <Stock ticker="GOOGL" />
        </div>
    );
}

export default App;
